export default function Navbar() {
    return (
        function Navbar() {
            return (
              <nav className="navbar">
                <div className="navbar-brand">
                  <img src="logo.svg" alt="Leverkusen-Manfort Logo" />
                  <span className="navbar-item">Leverkusen-Manfort</span>
                </div>
                <div className="navbar-end">
                  <span className="navbar-item">pizza boy</span>
                  <span className="navbar-item">My account</span>
                </div>
              </nav>
            );
          }

    )
}
